import Card from './Card';

export default function Board({ boardMap }) {
  console.log('boardMap: ', boardMap);
  const cardDivs = boardMap.forEach((row) => {
    row.forEach((card) => {
      return (<div>{card.word}</div>)
    })
  })
  return (
    <div>
      <div>{cardDivs}</div>
      <style jsx>{`
        main {
          width: 90%;
          max-width: 900px;
          margin: 300px auto;
          text-align: center;
        }
        .quote {
          font-family: cursive;
          color: #e243de;
          font-size: 24px;
          padding-bottom: 10px;
        }
        .author {
          font-family: sans-serif;
          color: #559834;
          font-size: 20px;
        }
      `}</style>
    </div>
  )
}
